import React from "react";

class Reservation extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            name: new Date()

        };
    }
    render(){
        return(
            <table class="table table-success table-striped-columns">
                 <thead>
                        <tr>
                        <th scope="col">반려동물 이름</th>
                        <th scope="col">달구</th>
                        <th scope="col">이름</th>
                        <th scope="col">김미소</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                        <th scope="row">반려동물 종류</th>
                        <td>믹스견(장모종)</td>
                        <td>전화번호</td>
                        <td>010-xxxx-xxxx</td>
                        </tr>
                        <tr>
                        <th scope="row">반려동물 성별</th>
                        <td>여(중성화)</td>
                        <td>주소</td>
                        <td>부산광역시 동래구 000</td>
                        </tr>
                        <tr>
                            <th scope="row">요청사항</th>
                            <td colspan="3">
                                df
                            </td>
                        </tr>
                    </tbody>
            </table>
        )
    }
        
}

function ReservationRequestBtn(){
    return(
        <div class="dropdown">
            <button class="btn btn-secondary dropdown-toggle" href="#" type="button" data-bs-toggle="dropdown" aria-expanded="false">
                첫 방문이에요! 방문해서 상담할게요
            </button>
            <ul class="dropdown-menu">                                    
                <li><a class="dropdown-item" href="#">저번 방문이랑 똑같이 해주세요</a></li>
                <li><a class="dropdown-item" href="#">낯을 많이 가려요! 같이 보낸 애착 장난감과 함께 진행해주세요</a></li>
                <li><a class="dropdown-item" href="#">끝나면 바로 연락 주세요! </a></li>
            </ul>
        </div>
    )
}

export default Reservation;
